import React from 'react';
import {connect} from 'react-redux'
import './view-lines.styles.scss'


const ViewLines = ({userTeam, opponentTeam}) => (
    <div className = 'view-lines'>
      <h1>View Lines</h1>  
      <div className = 'lineups' style={{display:'flex', width:'20%', marginLeft:'40%'}}>
      <table style={{marginRight:'2px'}}>
      {Object.keys(userTeam).map((position, i) => (<tr><td>{userTeam[position].name}</td><td>{Math.round(100*userTeam[position].projectedPoints)/100}</td></tr>))}
      </table>
      <table >
      {Object.keys(opponentTeam).map((position, i) => (<tr><td>{opponentTeam[position].name}</td><td>{Math.round(100*opponentTeam[position].projectedPoints)/100}</td></tr>))}
      </table>
      </div>
    </div>
)

const mapStateToProps = state => ({
  userTeam: state.lineup.userTeam,
  opponentTeam: state.lineup.opponentTeam
})
export default connect(mapStateToProps,null)(ViewLines)
